        protected void Button2_Click(object sender, EventArgs e)
        {
            using (StringWriter sw = new StringWriter())
            {
                using (HtmlTextWriter hw = new HtmlTextWriter(sw))
                {
                    Panel2.Visible = true;
                    Panel2.RenderControl(hw);
                    StringReader sr = new StringReader(sw.ToString());
                    Document pdfDoc = new Document(PageSize.A4, 50f, 50f, 50f, 50f);
                    PdfWriter writer = PdfWriter.GetInstance(pdfDoc, Response.OutputStream);
                    pdfDoc.Open();
                    iTextSharp.text.Image gif = null;

                    string base64string = "";
                    //  Convert base64string to bytes array
                    Byte[] bytes = Convert.FromBase64String(base64string);
                    gif = iTextSharp.text.Image.GetInstance(bytes);


                    gif.Alignment = iTextSharp.text.Image.ALIGN_LEFT;
                    gif.Border = iTextSharp.text.Rectangle.NO_BORDER;
                    gif.BorderColor = iTextSharp.text.BaseColor.WHITE;
                    gif.ScaleToFit(450f, 100f);

                    pdfDoc.Add(gif);
                    XMLWorkerHelper.GetInstance().ParseXHtml(writer, pdfDoc, sr);
                    pdfDoc.Close();
                    Response.ContentType = "application/pdf";
                    Response.AddHeader("content-disposition", "attachment;filename=ReportStdPerfbyTutGroup.pdf");
                    Response.Cache.SetCacheability(HttpCacheability.NoCache);
                    Response.Write(pdfDoc);
                    Response.End();
                    Panel2.Visible = false;
                }
            }
        }

